import ApiService from '../../../services/api.service'
export default {

    state: {

        func: {
            selected: null,
            loading: false,
            apiresponse: null
        },

        funccoleta: {
            selected: null,
            loading: false,
            apiresponse: null
        },

        funcqrcode: {
            selected: null,
            loading: false,
            apiresponse: null
        }
            
    },

    getters: {

        // funcionario ...
        gtxfuncresponse: state => state.func.apiresponse,
        gtxfuncloading: state => state.func.loading,
        gtxfuncSuccess: (state, getters ) => (getters.gtxfuncresponse) ? getters.gtxfuncresponse.Success=='True' : false,
        gtxfuncError: (state, getters) => (getters.gtxfuncSuccess) ? { Success: false, Error: getters.gtxfuncresponse.Error } : [],
        gtxfuncData: (state, getters ) => (getters.gtxfuncSuccess) ? getters.gtxfuncresponse.Data :  [],
        
        // coleta ...
        gtxfunccoletaresponse: state => state.funccoleta.apiresponse,
        gtxfunccoletaloading: state => state.funccoleta.loading,
        gtxcoletaSuccess: (state, getters ) => (getters.gtxfunccoletaresponse) ? getters.gtxfunccoletaresponse.Success=='True' : false,
        gtxcoletaError: (state, getters) => (getters.gtxcoletaSuccess) ? { Success: false, Error: getters.gtxfunccoletaresponse.Error } : [],
        gtxcoletaData: (state, getters ) => (getters.gtxcoletaSuccess) ? getters.gtxfunccoletaresponse.Data : [],

        // QRCodes ...
        gtxfuncqrcoderesponse: state => state.funcqrcode.apiresponse,
        gtxfuncqrcodeSuccess: (state, getters ) => (getters.gtxfuncqrcoderesponse) ? getters.gtxfuncqrcoderesponse.Success=='True' : false,
        gtxfuncqrcodeError: (state, getters) => (getters.gtxfuncqrcodeSuccess) ? { Success: false, Error: getters.gtxfuncqrcoderesponse.Error } : [],
        gtxfuncqrcodeData: (state, getters ) => (getters.gtxfuncqrcodeSuccess) ? getters.gtxfuncqrcoderesponse.Data : [],

    },
    
    mutations: {

        setfuncresponse: (state, data) => state.func.apiresponse = data,
        setfuncloading: (state, isload) => state.func.loading = isload,

        setfunccoleta: (state, data) => state.funccoleta.apiresponse = data,
        setfunccoletaloading: (state, isload) => state.funccoleta.loading = isload,

        setfuncqrcoderesponse: (state, data) => state.funcqrcode.apiresponse = data,
        setfuncqrcodeloading: (state, isload) => state.funcqrcode.loading = isload,
    },

    actions: {

        actfuncbuscar: ({ commit }, pesquisa) => {

            const params = {
                params: pesquisa
            }

            // console.log('partlist.actpartlist:hit')

            commit('setfuncloading', true)
            ApiService.get('Servicos/Funcionarios/Select', params)
                .then(data => {
                
                    // console.log('actfuncbuscar.get.params:', params)
                    // console.log('actfuncbuscar.get:', data)
                
                    commit('setfuncloading', false)
                    commit('setfuncresponse', data.data)
                })
                .catch(e => {
                    console.log('actfuncbuscar.error:', e)
                    commit('setfuncloading', false)

                })
        },

        actfuncqrcodebuscar: ({ commit }, query) => {
            const params = {
                params: query
            }

            // console.log('partlist.actpartlist:hit')

            commit('setfuncqrcodeloading', true)
            ApiService.get('Servicos/Funcionarios/QRCode', params)
                .then(data => {
                
                    commit('setfuncqrcoderesponse', data.data)
                    commit('setfuncqrcodeloading', false)

                })
                .catch(e => {
                    console.log('acqrcodebuscar.error:', e)
                    commit('setfuncqrcodeloading', false)

                })
            
        },

        acttriageminsert: ({ commit, dispatch }, data) => {

            const body = {
                UID: data.codigo,
                Data: data.data,
                Temperatura: data.temperatura,
                febre: data.febre,
                tosse: data.tosse,
                coriza: data.coriza,
                dordecabeca: data.dordecabeca,
                familiarcom: data.familiarcom,
                semsintomas: data.semsintomas,
                dordegarganta: data.dordegarganta,
                dificuldaderespiratoria: data.dificuldaderespiratoria,
                faltadepaladar: data.faltadepaladar,
                dor: data.dor,
                olfato: data.olfato,
                diarreia: data.diarreia,
            };
            
            commit('setfunccoletaloading', true)
            ApiService.post('Servicos/Funcionarios/TriagemInsert2', body)
                .then(data => {
                
                    console.log('acttriageminsert.post.body:', body)
                    console.log('acttriageminsert.post:', data)
                
                    commit('setfunccoletaloading', false)
                    commit('setfuncresponse', data.data)
                    dispatch('actToast', {message: 'Coleta realizada com sucesso!', variant: 'success'})
                })
                .catch(e => {
                    console.log('acttriageminsert.error:', e)
                    commit('setfunccoletaloading', false)
                    dispatch('actToast', {message: 'Erro ao realizar a coleta!', variant: 'danger'})
                })

        }

    }

}
